import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract product data from featured products
    await page.waitForSelector('.product-card');
    const products = await page.$$eval('.product-card', cards => 
      cards.map(card => ({
        title: card.querySelector('.product-title')?.textContent || '',
        price: card.querySelector('.product-price')?.textContent || '',
        rating: card.querySelector('.stars')?.textContent || '',
        reviews: card.querySelector('.rating-count')?.textContent || '',
        seller: card.querySelector('.seller-info')?.textContent || ''
      }))
    );

    // Extract category data
    await page.waitForSelector('.category-card');
    const categories = await page.$$eval('.category-card', cards => 
      cards.map(card => ({
        name: card.querySelector('h3')?.textContent || '',
        link: card.querySelector('a')?.textContent || ''
      }))
    );

    // Extract navigation links
    const navLinks = await page.$$eval('a', links => 
      links.map(link => ({
        text: link.textContent.trim(),
        href: link.href
      })).filter(link => link.text.length > 0)
    );

    // Extract user account links
    const accountLinks = await page.$$eval('.dropdown-content a', links => 
      links.map(link => ({
        text: link.textContent.trim(),
        href: link.href
      }))
    );

    // Extract footer links
    const footerLinks = await page.$$eval('.footer-section a', links => 
      links.map(link => ({
        text: link.textContent.trim(),
        href: link.href
      }))
    );

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    // Simulate bulk data collection by clicking through various sections
    await page.click('.account-lists');
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_account_dropdown.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_account_dropdown.png'));

    // Collect search suggestions
    await page.fill('#searchInput', 'electronics');
    await page.waitForTimeout(500);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_search_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_search_suggestions.png'));

    // Extract all text content for comprehensive data collection
    const pageContent = await page.$eval('body', el => el.textContent);
    const wordCount = pageContent.split(/\s+/).length;
    const linkCount = await page.$$eval('a', links => links.length);

    return {
      success: true,
      action: "Extracted product data, categories, navigation links, and page content in bulk",
      extractedData: {
        products,
        categories,
        navLinks: navLinks.slice(0, 20), // Limit to first 20 for brevity
        accountLinks,
        footerLinks: footerLinks.slice(0, 15), // Limit to first 15 for brevity
        contentMetrics: {
          wordCount,
          linkCount,
          characterCount: pageContent.length
        }
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
